(13, 'Sed malesuada arcu nec libero pulvinar rutrum.', NULL, '<p>Itu menjadi salah satu alasan kenapa nggak tertarik dengan teknologi.Tapi aku tak berputus asa, setelah lulus kuliah aku mendalami lagi ketertarikanku akan ilmu komputer dan mulai saat itu aku baru tau yang namanya programming. Awal pertama kali belajar benar-benar bingung sekali dan sulit sekali mengingat semua bahasa pemrograman itu. Aku penasaran kenapa kok aku belum bisa? Ternyata kesalahanku ada dalam cara belajarku aku belajar programming dengan cara mengingat, kalau aku tetap seperti ini mau sampai kapanpun bahasa-bahasa itu tidak akan bisa aku ingat semua.</p>\r\n\r\n<p>Belajar itu bukan menghafal tapi memahami. Jadi aku mulai memahami bagaimana cara kerja program, dari mulai bagaimana website dibuat. Website yang pertama kali aku buat adalah website sekolah menggunakan bahasa pemrograman php, untuk kebutuhan laporan pkl ku. Dari saat itu aku mulai terus menerus belajar lebih banyak tentang pemrograman meskipun pada saat itu aku masih belajar otodidak sampai pada akhirnya temanku mengirim pesan WA. Dia ngasih tau kalau ada program bootcamp arkademy dimana aku bisa belajar programming bersama banyak orang dan dibimbing oleh mentor. Teruntuk temanku yang mengirim pesan WA tentang Arkademy aku ingin mengucapkan banyak terima kasih, kalau saja kamu tidak menginfokannya padaku mungkin aku tidak bisa di titik sekarang ini.</p>\r\n\r\n<p>Dengan masuk ke program bootcamp arkademy aku menaruh harapan yang paling besar melalui arkademy aku berharap bisa mendapatkan pekerjaan di bidang programming dimana selain meningkatkan pengalaman dan skill aku juga bisa mendapatkan uang dari apa yang aku lakukan.</p>\r\n', 'default.jpg', '2020-02-04 14:05:08', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 11, 0, 0, '2020-03-25 10:42:32', 'Y'),
